import React, { Component } from 'react';
import { View, Text, StyleSheet,FlatList,Image} from 'react-native';

// create a component
const App = () => {
  return (
     <View style={styles.container}>

       <View style={styles.card}>

         <Image source={{uri:'https://thekitchencommunity.org/wp-content/uploads/2021/03/43-Foods-That-Start-With-D-1200x900.jpg'}} 
         resizeMode="contain"/>
         <View style={styles.content}>

         </View>
       </View>

    </View>
  );
};

// define your styles
const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#2c3e50',
  },
  card:{
    height:300,
    width:300,
    backgroundColor:'#a29bfe',
    shadowColor:'black',
    shadowOffset:{
      width:20,
      height:10
    },
    shadowOpacity:0.75,
    elevation:11,
    borderRadius:20
  }
});


//make this component available to the app
export default App;
